    "2013-03-15T23:39:17.988039",nt"name": "washington-well-log-observational-data",nt"isopen":
    false,nt"url": null,nt"notes": "These data contain basic information describing
    well logs and compiled by the Washington Division of Geology and Earth Resources,
    published by the AZGS as a downloadable file, ESRI Service, Web Map Service,  and
    as a Web Feature service for the National Geothermal Data System. The documents
    contain 9 worksheets, including information about the template, notes related to
    revisions of the template, Resource provider information, the data, a field list
    (data mapping view) and a worksheet with vocabularies for use in populating the
    spreadsheet (data valid terms). Data from 80,782 total well logs are included. Fields
    in the data table include Well Name, API Number,  Ended Drilling Date, Well Type,
    Bottom Logged Interval,and Log Notes.",nt"license_title": null,nt"extras":
